    e.preventDefault();
    console.log(`Name: ${name} Email: ${email} Password: ${password} Confirm Password: ${rePassword}`)
    const loginData={
      name:name,
      email:email,
      password:password,
      re_password:rePassword
      
    }
    console.log(loginData)
  }
  return (
    <div>
        <form>
      
        <span>Email</span>
        <input type='text'value={email} onChange={(event)=>setEmail(event.target.value)} /><br/>
        <span>Password</span>
        <input type='text'value={password} onChange={(event)=>setPassword(event.target.value)} /><br/>
        
        <input type='Button' value='Submit' onClick={handleSubmit} />

      </form>
    </div>
  )
}
